import React from "react";

export default function ItemCardMovie({
  hinhAnh,
  tenPhim,
  soSao,
  thongTinPhim,
  sayHello,
}) {
  // props.hinhAnh , props.tenPhim
  //   const { hinhAnh, tenPhim } = props;

  return (
    <div className="mx-3">
      <img src={hinhAnh} alt="" width={200} height={300} />
      <p>{tenPhim}</p>
      <p>{soSao} điểm</p>
      <p>{thongTinPhim?.content}</p>
      <p>{thongTinPhim?.ngayChieu}</p>
      <button
        onClick={() => {
          sayHello(tenPhim);
        }}
        className="btn btn-success"
      >
        Hello
      </button>
    </div>
  );
}
